using System.IO;
using System.Net;
using HtmlAgilityPack;

namespace CountryStuff
{
    public class HtmlService : IHtmlService
    {
        public HtmlDocument GetWebPage(string url)
        {
            WebClient client = new WebClient();
            HtmlDocument doc = new HtmlDocument();
            doc.Load(new MemoryStream(client.DownloadData(url)));
            return doc;
        }
    }

    /// <summary>
    /// Psuedo crappy static html service. Yes. This is crap. 
    /// </summary>
    public class KindOfFakeHtmlService : IHtmlService
    {
        public HtmlDocument GetWebPage(string url)
        {
            var htmlText = GetHtmlText(url);
            HtmlDocument doc = new HtmlDocument();
            doc.LoadHtml(htmlText);
            return doc;
        }

        private static string GetHtmlText(string url)
        {
            var lowUrl = url.ToLowerInvariant();
            if (lowUrl.Contains("a-c")) return PageAToC;
            if (lowUrl.Contains("d-i")) return DtoI;
            if (lowUrl.Contains("j-p")) return JtoP;
            
            return QtoZ;
        }

