<body class=""mediawiki ltr sitedir-ltr ns-0 ns-subject page-List_of_country_names_in_various_languages_D–I skin-vector action-view"">
		<div id=""mw-page-base"" class=""noprint""></div>
		<div id=""mw-head-base"" class=""noprint""></div>
		<!-- content -->
		<div id=""content"" class=""mw-body"">
			<a id=""top""></a>
			<div id=""mw-js-message"" style=""display:none;"" class=""js-messagebox""></div>
						<!-- sitenotice -->
			<div id=""siteNotice""><!-- centralNotice loads here --></div>
			<!-- /sitenotice -->
						<!-- firstHeading -->
			<h1 id=""firstHeading"" class=""firstHeading"">
				<span dir=""auto"">List of country names in various languages (D–I)</span>
			</h1>
			<!-- /firstHeading -->
			<!-- bodyContent -->
			<div id=""bodyContent"">
								<!-- tagline -->
				<div id=""siteSub"">From Wikipedia, the free encyclopedia</div>
				<!-- /tagline -->
								<!-- subtitle -->
				<div id=""contentSub""></div>
				<!-- /subtitle -->
																<!-- jumpto -->
				<div id=""jump-to-nav"" class=""mw-jump"">
					Jump to: <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#mw-head"">navigation</a>,
					<a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#p-search"">search</a>
				</div>
				<!-- /jumpto -->
								<!-- bodycontent -->
				<div id=""mw-content-text"" lang=""en"" dir=""ltr"" class=""mw-content-ltr""><p>Most <b>countries of the world</b> have <b>different names</b> in different languages. Some countries have also undergone name changes for political or other reasons. This article attempts to give all known alternative names for all nations, countries and sovereign states. It does not offer any opinion about what the ""original"", ""official"", ""real"", or ""correct"" name of any country is or was.</p>
<p>Countries are listed alphabetically by their <b>current best-known name in English</b>. Each English name is followed by its currently best-known equivalents in other languages, listed in English alphabetical order (ignoring accents) by name and by language. Historical and/or alternative versions, where included, are noted as such. Foreign names that are the same as their English equivalents are listed, to provide an answer to the question ""What is that name in...""?. See also: <a href=""http://en.wikipedia.org/wiki/List_of_alternative_country_names"" title=""List of alternative country names"">List of alternative country names</a></p>
<p>Please format entries as follows: for languages written in the Latin alphabet, write ""<b>Name</b> (language)"", for example, ""<b>Afeganistão</b> (Portuguese)"", and alphabetize it in the list according to English rules of alphabetical order. For languages written in other <a href=""http://en.wikipedia.org/wiki/Writing_system"" title=""Writing system"">writing systems</a>, write ""<b>Romanization</b> - native script (language)"", for example ""<b>Argentine</b> - אַרגענטינע (Yiddish)"", and alphabetize it in the list by the romanized form.</p>
<p>For reasons of size, this article is broken into four parts:</p>
<ul>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(A%E2%80%93C)"" title=""List of country names in various languages (A–C)"">List of country names in various languages (A–C)</a></li>
<li><b>List of country names in various languages (D–I)</b></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)"" title=""List of country names in various languages (J–P)"">List of country names in various languages (J–P)</a></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)"" title=""List of country names in various languages (Q–Z)"">List of country names in various languages (Q–Z)</a></li>
</ul>
<p><br>
<b>Table of contents:</b> <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#D"">D</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#E"">E</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#F"">F</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#G"">G</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#H"">H</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)#I"">I</a></p>
<h2><span class=""editsection"">[<a href=""http://en.wikipedia.org/w/index.php?title=List_of_country_names_in_various_languages_(D%E2%80%93I)&action=edit&section=1"" title=""Edit section: D"">edit</a>]</span> <span class=""mw-headline"" id=""D"">D</span></h2>
<table border=""1"" cellspacing=""0"" cellpadding=""3"">
<tbody><tr>
<th><b>English Name</b></th>
<th><b>Other name(s) or older name(s)</b></th>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Denmark"" title=""Denmark"">Denmark</a></td>
<td><b>Danemarc</b> (Romansh), <b>Danemarca</b> (Romanian), <b>Dänemark</b> (Alemannic, German, Low Saxon), <b>Danemark</b> (French), <b>Dania</b> - Դանիա (Armenian), <b>Dania</b> - დანია (Georgian), <b>Danía</b> - <i>Δανία</i> (Greek), <b>Dánia</b> (Hungarian), <b>Dania</b> (Latin, Polish), <b>Danija</b> - <i>Данія</i> (Belarusian, Ukrainian), <b>Dānija</b> (Latvian), <b>Danija</b> (Lithuanian), <b>Danimarca</b> (Italian), <b>Danimarka</b> (Azeri, Basque, Maltese, Turkish), <b>Danimarkë</b> (Albanian), <b>Danio</b> (Esperanto), <b>Daniya</b> - <i>Дания</i> (Bulgarian, Russian), <b>Đan Mạch</b> (Vietnamese), <b>Dānmài</b> - 丹麥 / 丹麦 (Mandarin Chinese), <b>ad-Dānmārk</b> - الدنمارك (Arabic), <b>Danmark</b> (Breton, Danish, Faroese, Interlingua, Norwegian, Swedish), <b>an Danmhairg</b> (Irish, Scots Gaelic), <b>Danmörk</b> (Icelandic), <b>Danska</b> (Croatian, Slovene), <b>Dańska</b> (Lower Sorbian), <b>Danska</b> - <i>Данска</i> (Serbian), <b>Dánsko</b> (Czech, Slovak), <b>Demmāku</b> - デンマーク (Japanese), <b>Denemark</b> (Frisian), <b>Denemark</b> - דנמרק (Hebrew), <b>Denemarke</b> (Afrikaans), <b>Denemarken</b> (Dutch), <b>Deniya</b> - דנמרק (Hebrew obsolete), <b>Denmakeu</b> / <b>Tenmak'ŭ</b> - 덴마크 (Korean), <b>Denmarc</b> (Welsh), <b>Denmark</b> (Acehnese), <b>Denmark</b> - ዴንማርክ (Amharic), <b>Dēnmārk</b> - เดนมาร์ก (Thai), <b>Denmark</b> - דענמאַרק (Yiddish), <b>Dinamarca</b> (Aragonese, Catalan, Portuguese, Spanish), <b>Dinamarka</b> (Filipino/Tagalog), <b>Juutinmaa</b> (old Finnish alternative), <b>Qallunaat Nunaat</b> (Kalaallisut), <b>Taani</b> (Estonian, Võro), <b>Tanska</b> (Finnish), <b>Tingmaak</b> (Inuktitut)</td>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Djibouti"" title=""Djibouti"">Djibouti</a></td>
<td><b>Čhibūtī</b> - จิบูตี (Thai), <b>Cibuti</b> (Turkish), <b>Djiboeti</b> (Afrikaans), <b>Djibouti</b> (Acehnese, Breton, Catalan, Danish, Dutch, Estonian, Finnish, French, Norwegian, Portuguese, Romanian, Scots Gaelic, Swedish, Võro), <b>Djíbútí</b> (Icelandic), <b>Djibuti</b> (Portuguese variant), <b>Djibŵti</b> (Welsh), <b>Dschibuti</b> (Alemannic, German), <b>Dzhybuti</b> - <i>Джибути</i> (Bulgarian, Russian), <b>Džibuti</b> (Bosnian, Croatian, Czech alternate, Slovene), <b>Džibuti</b> (Latvian), <b>Dżibuti</b> (Polish), <b>Džibuti</b> - <i>Џибути</i> (Serbian), <b>Džibutis</b> (Lithuanian), <b>Džibutsko</b> (Czech, Slovak), <b>Dzibutum</b> (Latin), <b>Dzsibuti</b> (Hungarian), <b>Džybuci</b> - <i>Джыбуці</i> (Belarusian), <b>Džybuti</b> - <i>Джибуті</i> (Ukrainian), <b>Ǧebuti</b> - ጅቡቲ (Amharic), <b>Ǧībūtī</b> - جيبوتي (Arabic), <b>Gibuti</b> (Italian), <b>Ĝibutio</b> (Esperanto), <b>Jibuchi</b> - ジブチ (Japanese), <b>Jibuti</b> - ג'יבוטי (Hebrew), <b>Jibuti</b> / <b>Chibut'i</b> - 지부티 (Korean), <b>Jíbùtí</b> - 吉布提 (Mandarin Chinese), <b>Jibuti</b> (Portuguese variant), <b>Jipuuti</b> (Inuktitut), <b>Tzimpoutí</b> - <i>Τζιμπουτί</i> (Greek), <b>Yibuti</b> (Spanish)</td>
</tr>
