			<div id=""siteNotice""><!-- centralNotice loads here --></div>
			<!-- /sitenotice -->
						<!-- firstHeading -->
			<h1 id=""firstHeading"" class=""firstHeading"">
				<span dir=""auto"">List of country names in various languages (J–P)</span>
			</h1>
			<!-- /firstHeading -->
			<!-- bodyContent -->
			<div id=""bodyContent"">
								<!-- tagline -->
				<div id=""siteSub"">From Wikipedia, the free encyclopedia</div>
				<!-- /tagline -->
								<!-- subtitle -->
				<div id=""contentSub""></div>
				<!-- /subtitle -->
																<!-- jumpto -->
				<div id=""jump-to-nav"" class=""mw-jump"">
					Jump to: <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#mw-head"">navigation</a>,
					<a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#p-search"">search</a>
				</div>
				<!-- /jumpto -->
								<!-- bodycontent -->
				<div id=""mw-content-text"" lang=""en"" dir=""ltr"" class=""mw-content-ltr""><p>Most <b>countries of the world</b> have <b>different names</b> in different languages. Some countries have also undergone name changes for political or other reasons. This article attempts to give all known alternative names for all nations, countries and sovereign states. It does not offr any opinion about what the ""original"", ""official"", ""real"", or ""correct"" name of any country is or was.</p>
<p>Countries are listed alphabetically by their <b>current best-known name in English</b>. Each English name is followed by its currently best-known equivalents in other languages, listed in English alphabetical order (ignoring accents) by name and by language. Historical and/or alternative versions, where included, are noted as such. Foreign names that are the same as their English equivalents are listed, to provide an answer to the question ""What is that name in...""?. See also: <a href=""http://en.wikipedia.org/wiki/List_of_alternative_country_names"" title=""List of alternative country names"">List of alternative country names</a></p>
<p>Please format entries as follows: for languages written in the Latin alphabet, write ""<b>Name</b> (language)"", for example, ""<b>Afeganistão</b> (Portuguese)"", and alphabetize it in the list according to English rules of alphabetical order. For languages written in other <a href=""http://en.wikipedia.org/wiki/Writing_system"" title=""Writing system"">writing systems</a>, write ""<b>Romanization</b> - native script (language)"", for example ""<b>Argentine</b> - אַרגענטינע (Yiddish)"", and alphabetize it in the list by the romanized form.</p>
<p>For reasons of size, this article is broken into four parts:</p>
<ul>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(A%E2%80%93C)"" title=""List of country names in various languages (A–C)"">List of country names in various languages (A–C)</a></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)"" title=""List of country names in various languages (D–I)"">List of country names in various languages (D–I)</a></li>
<li><b>List of country names in various languages (J–P)</b></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)"" title=""List of country names in various languages (Q–Z)"">List of country names in various languages (Q–Z)</a></li>
</ul>
<p><br>
<b>Table of contents:</b> <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#J"">J</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#K"">K</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#L"">L</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#M"">M</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#N"">N</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#O"">O</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)#P"">P</a></p>
<h2><span class=""editsection"">[<a href=""http://en.wikipedia.org/w/index.php?title=List_of_country_names_in_various_languages_(J%E2%80%93P)&action=edit&section=1"" title=""Edit section: J"">edit</a>]</span> <span class=""mw-headline"" id=""J"">J</span></h2>
<table border=""1"" cellspacing=""0"" cellpadding=""3"">
<tbody><tr>
<th><b>English Name</b></th>
