</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Jamaica"" title=""Jamaica"">Jamaica</a></td>
<td><b>Chamaica</b> (Aragonese), <b>Čhāmaikā</b> - จาไมกา (Thai), <b>Ǧāmāykā</b> - ጃማይካ (Amharic), <b>Ġammajka</b> (Maltese), <b>Giamaica</b> (Italian), <b>Hamayka</b> (Filipino/Tagalog), <b>Iamaĭka</b> - <i>Ямайка</i> (Belarusian), <b>Jamaica</b> (<a href=""http://en.wikipedia.org/wiki/Danish_language"" title=""Danish language"">Danish</a>, <a href=""http://en.wikipedia.org/wiki/Dutch_language"" title=""Dutch language"">Dutch</a>, <a href=""http://en.wikipedia.org/wiki/Estonian_language"" title=""Estonian language"">Estonian</a>, <a href=""http://en.wikipedia.org/wiki/Hungarian_language"" title=""Hungarian language"">Hungarian</a>, <a href=""http://en.wikipedia.org/wiki/Latin_language"" title=""Latin language"" class=""mw-redirect"">Latin</a>, <a href=""http://en.wikipedia.org/wiki/Min_Nan"" title=""Min Nan"">Min Nan</a>, <a href=""http://en.wikipedia.org/wiki/Norwegian_language"" title=""Norwegian language"">Norwegian</a>, <a href=""http://en.wikipedia.org/wiki/Portuguese_language"" title=""Portuguese language"">Romanian</a>, <a href=""http://en.wikipedia.org/wiki/Spanish_language"" title=""Spanish language"">Spanish</a>, <a href=""http://en.wikipedia.org/wiki/Swedish_language"" title=""Swedish language"">Swedish</a>, <a href=""http://en.wikipedia.org/wiki/V%C3%B5ro_language"" title=""Võro language"">Võro</a>, <a href=""http://en.wikipedia.org/wiki/Welsh_language"" title=""Welsh language"">Welsh</a>), <b>Jamaika</b> (<a href=""http://en.wikipedia.org/wiki/Acehnese_language"" title=""Acehnese language"">Acehnese</a>, <a href=""http://en.wikipedia.org/wiki/Afrikaans"" title=""Afrikaans"">Afrikaans</a>, <a href=""http://en.wikipedia.org/wiki/Alemannic_German"" title=""Alemannic German"">Alemannic</a>, <a href=""http://en.wikipedia.org/wiki/Faroese_language"" title=""Faroese language"">Faroese</a>, <a href=""http://en.wikipedia.org/wiki/Finnish_language"" title=""Finnish language"">Finnish</a>, <a href=""http://en.wikipedia.org/wiki/German_language"" title=""German language"">German</a>, Indonesian, Inuktitut, Latvian, Lithuanian, Turkish), <b>Jamaika</b> - جامايكا (Arabic, Persian), <b>Jamaika</b> - ג'אמייקה (Hebrew), <b>Jamaika</b> - ジャマイカ (Japanese), <b>Jamaïque</b> (French), <b>Jamajka</b> (Croatian, Czech, Polish, Slovak, Slovene), <b>Jamajka</b> - <i>Јамајка</i> (Serbian), <b>Jamajko</b> (Esperanto), <b>J·amayica</b> (Franco-Provençal), <b>Jamayka</b> - Ջամայկա (Armenian), <b>Jameika</b> / <b>Chameik'a</b> - 자메이카 (Korean), <b>Semeuca</b> (Scots Gaelic), <b>Tzamáika</b> - <i>Ιαμαϊκή</i> (Greek), <b>Xamaica</b> (Asturian, <a href=""http://en.wikipedia.org/wiki/Leonese_language"" title=""Leonese language"">Leonese</a>), <b>Xamayka</b> (Aymara), <b>Xhamaijkë</b> (Albanian), <b>Yámǎijiā</b> - 牙買加/牙买加 (Mandarin Chinese), <b>Yamayka</b> (Azeri), <b>Yamayka</b> - <i>Ямайка</i> (Bulgarian, Russian, Ukrainian)</td>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Japan"" title=""Japan"">Japan</a></td>
<td><b>Chapón</b> (Aragonese), <b>Ǧāpān</b> - ጃፓን (Amharic), <b>Ġappun</b> (Maltese), <b>Giappone</b> (Italian), <b>Giapun</b> (Romansh), <b>Hapón</b> (Filipino/Tagalog), <b>Hapõñ</b> (Guarani), <b>Iapan</b> (Scots Gaelic), <b>Iaponía</b> - <i>Ιαπωνία</i> (Greek), <b>Iaponia</b> (Latin), <b>Ilbon</b> - 일본(日本) (Korean), <b>Jaapan</b> (Estonian, Võro), <b>Japan</b> (Afrikaans, Alemannic, Danish, Dutch, Faroese, German, Norwegian, Swedish), <b>Japán</b> (Hungarian), <b>Japan</b> - <i>Јапан</i> (Serbian), <b>Jāpāna</b> - জাপান (Assamese, Bengali), <b>Japāna</b> (Latvian), <b>Japani</b> (Finnish), <b>Japanio</b> (Esperanto), <b>Japanip Inuujarvik</b> (Inuktitut), <b>Japańska</b> (Lower Sorbian), <b>Japão</b> (Portuguese), <b>el Japó</b> (Catalan), <b>J·apon</b> (Franco-Provençal), <b>Japon</b> (French, Interlingua), <b>Japon</b> - ژاپن (Persian), <b>Japón</b> (Spanish), <b>Japonia</b> (Albanian, Polish, Romanian), <b>Japonia</b> - Ճապոնիա (Armenian), <b>Japonija</b> (Lithuanian), <b>Japonska</b> (Slovene), <b>Japonsko</b> (Czech, Slovak), <b>Japonya</b> (Turkish), <b>Jepang</b> (Indonesian), <b>Jepun</b> (Malay), <b>Jeupun</b> (Acehnese), <b>Ji̍t-pún</b> (Min Nan), <b>Nhật Bản</b>, <b>Nhật Bổn</b>, or <b>Nhật Bủn</b> (Vietnamese), <b>Nippon</b> or <b>Nihon</b> - 日本 (Japanese), <b>Rìběn</b> - 日本 (Mandarin Chinese), <b>an tSeapáin</b> (Irish), <b>Siapan</b> (Welsh), <b>Xapón</b> (Asturian, Galician, Leonese), <b>al-Yābān</b> - اليابان (Arabic), <b>Yapan</b> - יפן (Hebrew), <b>Yapan</b> - יאַפּאַן (Yiddish), <b>Yaponiya</b> (Azeri), <b>Yaponiya</b> - <i>Япoния</i> (Bashkir, Bulgarian, Russian), <b>Yaponiya</b> - <i>Япoнія</i> (Ukrainian), <b>Yīpun</b> - ญี่ปุ่น (Thai)</td>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Jordan"" title=""Jordan"">Jordan</a></td>
<td><b>Chordania</b> (Aragonese), <b>Čhordǣn</b> - จอร์แดน (Thai), <b>Giordania</b> (Italian), <b>Ġordan</b> (Maltese), <b>Hordan</b> (Filipino/Tagalog), <b>Hordanan</b> - Հորդանան (Armenian), <b>Iardaniia</b> - <i>Ярданія</i> (Belarusian), <b>Iok-tàn</b> (Min Nan), <b>Iòrdan</b> (Scots Gaelic), <b>Iordanía</b> - <i>Ιορδανία</i> (Greek), <b>Iordania</b> (Romanian), <b>Iordaniya</b> - <i>Иордания</i> (Russian), <b>Iorddonen</b> (Welsh), <b>Jardāna</b> - জর্দান (Bengali), <b>Jordaania</b> (Estonian, Võro), <b>Jordan</b> (Croatian, Danish, Faroese, Malay, Norwegian), <b>Jordan</b> - <i>Јордан</i> (Serbian), <b>Jordania</b> (Albanian, Finnish, Interlingua, Latin, Polish, Spanish), <b>Jordánia</b> (Hungarian), <b>Jórdanía</b> - (Icelandic), <b>Jordânia</b> (Portuguese), <b>Jordanië</b> (Afrikaans, Dutch), <b>J·ordanie</b> (Franco-Provençal), <b>Jordanie</b> (French), <b>Jordanien</b> (Alemannic, German, Swedish), <b>Jordānija</b> (Latvian), <b>Jordanija</b> (Lithuanian, Slovene), <b>Jordanio</b> (Esperanto), <b>Jordánsko</b> (Czech, Slovak), <b>Jurutan</b> (Inuktitut), <b>Rjor-ḍana</b> - རྗོར་ཌན། རྗ (Tibetan), <b>al-Urdun</b> - الأردن (Arabic), <b>Ürdün</b> or <b>İordaniya</b> (Azeri), <b>Ürdün</b> (Turkish), <b>Xordania</b> (Asturian), <b>Xordaña</b> (Leonese) <b>Yarden</b> - ירדן (Hebrew), <b>Yardn</b> - ירדן (Yiddish), <b>Yordania</b> (Acehnese, Indonesian), <b>Yordaniya</b> - <i>Йордания</i> (Bulgarian), <b>Yordaniya</b> - <i>Йорданія</i> (Ukrainian), <b>Yordanya</b> (Central Bikolano), <b>Yoreudan</b> / <b>Yorŭdan</b> - 요르단 (Korean), <b>Yorudan</b> - ヨルダン (Japanese), <b>Yuēdàn</b> - 約旦/约旦 (Chinese)
<p>Formerly <b>Mavera-i Ürdün</b> (Turkish), <b>Teuranseu Yoreudan</b> / <b>T'ŭransŭ Yorŭdan</b> - 트란스 요르단 (Korean), <b>Transgiordania</b> (Italian), <b>Transjordan</b> (Danish, English, Malay, Norwegian), <b>Transjordania</b> (Finnish, Polish, Spanish), <b>Transjordânia</b> (Portuguese), <b>Transjordanië</b> (Dutch), <b>Transjordanie</b> (French), <b>Transjordanien</b> (German, Swedish), <b>Transjordánsko</b> (Czech), <b>Transyordania</b> (Indonesian), <b>Wàiyuēdàn</b> - 外约旦 (Mandarin Chinese)</p>
</td>
</tr>
</tbody></table>
<h2><span class=""editsection"">[<a href=""http://en.wikipedia.org/w/index.php?title=List_of_country_names_in_various_languages_(J%E2%80%93P)&action=edit&section=2"" title=""Edit section: K"">edit</a>]</span> <span class=""mw-headline"" id=""K"">K</span></h2>
<table border=""1"" cellspacing=""0"" cellpadding=""3"">
<tbody><tr>
<th><b>English Name</b></th>
<th><b>Other name(s) or older name(s)</b></th>
</tr>
