			<div id=""mw-js-message"" style=""display:none;"" class=""js-messagebox""></div>
						<!-- sitenotice -->
			<div id=""siteNotice""><!-- centralNotice loads here --></div>
			<!-- /sitenotice -->
						<!-- firstHeading -->
			<h1 id=""firstHeading"" class=""firstHeading"">
				<span dir=""auto"">List of country names in various languages (Q–Z)</span>
			</h1>
			<!-- /firstHeading -->
			<!-- bodyContent -->
			<div id=""bodyContent"">
								<!-- tagline -->
				<div id=""siteSub"">From Wikipedia, the free encyclopedia</div>
				<!-- /tagline -->
								<!-- subtitle -->
				<div id=""contentSub""></div>
				<!-- /subtitle -->
																<!-- jumpto -->
				<div id=""jump-to-nav"" class=""mw-jump"">
					Jump to: <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#mw-head"">navigation</a>,
					<a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#p-search"">search</a>
				</div>
				<!-- /jumpto -->
								<!-- bodycontent -->
				<div lang=""en"" dir=""ltr"" class=""mw-content-ltr""><p>Most <b>countries of the world</b> have <b>different names</b> in different languages. Some countries have also undergone name changes for political or other reasons. This article attempts to give all known alternative names for all nations, countries and sovereign states. It does not offer any opinion about what the ""original"", ""official"", ""real"", or ""correct"" name of any country is or was.</p>
<p>Countries are listed alphabetically by their <b>current best-known name in English</b>. Each English name is followed by its currently best-known equivalents in other languages, listed in English alphabetical order (ignoring accents) by name and by language. Historical and/or alternative versions, where included, are noted as such. Foreign names that are the same as their English equivalents are listed, to provide an answer to the question ""What is that name in...""?. See also: <a href=""http://en.wikipedia.org/wiki/List_of_alternative_country_names"" title=""List of alternative country names"">List of alternative country names</a></p>
<p>Please format entries as follows: for languages written in the Latin alphabet, write ""<b>Name</b> (language)"", for example, ""<b>Afeganistão</b> (Portuguese)"", and alphabetize it in the list according to English rules of alphabetical order. For languages written in other <a href=""http://en.wikipedia.org/wiki/Writing_system"" title=""Writing system"">writing systems</a>, write ""<b>Romanization</b> - native script (language)"", for example ""<b>Argentine</b> - אַרגענטינע (Yiddish)"", and alphabetize it in the list by the romanized form.</p>
<p>For reasons of size, this article is broken into four parts:</p>
<ul>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(A%E2%80%93C)"" title=""List of country names in various languages (A–C)"">List of country names in various languages (A–C)</a></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(D%E2%80%93I)"" title=""List of country names in various languages (D–I)"">List of country names in various languages (D–I)</a></li>
<li><a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(J%E2%80%93P)"" title=""List of country names in various languages (J–P)"">List of country names in various languages (J–P)</a></li>
<li><b>List of country names in various languages (Q–Z)</b></li>
</ul>
<p><br>
<b>Table of contents:</b> <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#Q"">Q</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#R"">R</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#S"">S</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#T"">T</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#U"">U</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#V"">V</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#W"">W</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#Y"">Y</a> — <a href=""http://en.wikipedia.org/wiki/List_of_country_names_in_various_languages_(Q%E2%80%93Z)#Z"">Z</a></p>
<h2><span class=""editsection"">[<a href=""http://en.wikipedia.org/w/index.php?title=List_of_country_names_in_various_languages_(Q%E2%80%93Z)&action=edit&section=1"" title=""Edit section: Q"">edit</a>]</span> <span class=""mw-headline"" id=""Q"">Q</span></h2>
<table border=""1"" cellspacing=""0"" cellpadding=""3"">
<tbody><tr>
<th><b>English Name</b></th>
<th><b>Other name(s) or older name(s)</b></th>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/Qatar"" title=""Qatar"">Qatar</a></td>
<td><b>Ca-ta</b> (Vietnamese), <b>Catar</b> (Portuguese variant, Scots Gaelic), <b>Kǎtǎ'ěr</b> - 卡塔爾/卡塔尔 (Mandarin Chinese), <b>Katar</b> (Afrikaans, Czech, Dutch alternate, Estonian, Faroese, German, Hungarian, Polish, Slovak, Slovene, Turkish), <b>Katar</b> - <i>Катар</i> (Bulgarian, Russian, Serbian, Ukrainian), <b>Katar</b> - קטאר (Hebrew), <b>K‘at‘ar</b> - Քաթար (Armenian), <b>Katár</b> - <i>Κατάρ</i> (Greek), <b>Katara</b> (Latvian), <b>Kataras</b> (Lithuanian), <b>Katareu</b> / <b>K'at'arŭ</b> - 카타르 (Korean), <b>Kataro</b> (Esperanto), <b>Katāru</b> - カタール (Japanese), <b>Qataaq</b> (Inuktitut), <b>Qatar</b> (Azeri, Danish, Dutch, Finnish, French, Indonesian, Interlingua, Italian, Malay, Maltese, Portuguese, Romanian, Spanish, Swedish, Tatar), <b>Qaṭar</b> - قطر (Arabic)</td>
</tr>
</tbody></table>
<h2><span class=""editsection"">[<a href=""http://en.wikipedia.org/w/index.php?title=List_of_country_names_in_various_languages_(Q%E2%80%93Z)&action=edit&section=2"" title=""Edit section: R"">edit</a>]</span> <span class=""mw-headline"" id=""R"">R</span></h2>
<table border=""1"" cellspacing=""0"" cellpadding=""3"">
<tbody><tr>
<th><b>English Name</b></th>
<th><b>Other name(s) or older name(s)</b></th>
</tr>
<tr>
<td><a href=""http://en.wikipedia.org/wiki/R%C3%A9union"" title=""Réunion"">Reunion</a></td>
<td><b>Adunia</b> (Welsh), <b>Liúníwāng</b> - 留尼汪 (Mandarin Chinese), <b>Miut‘yun</b> - Միություն (Armenian), <b>Reinion</b> - <i>Реинион</i> (Serbian), <b>Reinjona</b> (Latvian), <b>Reunião</b> (Portuguese), <b>Reunion</b> (Polish), <b>Réunion</b> (Czech, Dutch, Estonian, Finnish, German), <b>Reunjonas</b> (Lithuanian), <b>Rewiniong</b> - 레위니옹 (Korean), <b>Reyunion</b> - <i>Реюнион</i> (Bulgarian), <b>Reyun'yon</b> - <i>Реюньйон</i> (Ukrainian), <b>Reyunion</b> - レユニオン (Japanese), <b>Rijuniun</b> (Inuktitut), <b>Riunione</b> (Italian, old)</td>
</tr>
